import React from "react";

const Quote = () => {
  return (
    <Box
      style={{
        marginTop: "120px",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Box
        style={{
          marginTop: "30px",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          width: "800px",

          overflow: "auto",
        }}
      ></Box>
    </Box>
  );
};

export default Quote;
